  "description": "<p><b><i>Remember tasting Biryani for the first time and falling in love?</i></b></p>\n<p><b><i>The fragrant aroma that hits your nose before the burst of flavours in your mouth?</i></b></p>\n<p><b><i>Bad news:</i></b><b><i> You may never be able to taste Biryani for the first time again. :(</i></b></p>\n<p><b><i>Good news:</i></b><b><i> Your dog can! :)</i></b></p>\n<p><b><i>Sara's Wholesome Food: Biryani variants bring the crown jewel of the culinary world, the flavours of India straight to your dog's bowl!</i></b></p>\n<p><span style=\"font-weight: 400;\">Formulated by canine nutritionists, Sara's Wholesome Food is an all-natural, ready-to-eat meal made using fresh, human-grade ingredients. Our brand-new Chicken Biryani variant is made of </span><b>purposeful ingredients</b><span style=\"font-weight: 400;\"> like chicken, chicken organ meat, beans, carrot, pumpkin, potato, curd, ghee and more. It also has all the doggy-friendly aromatic spices for that PERFECT biryani that hits the spot: </span><i><span style=\"font-weight: 400;\">haldi </span></i><span style=\"font-weight: 400;\">(turmeric), </span><i><span style=\"font-weight: 400;\">daal-chini</span></i><span style=\"font-weight: 400;\"> (cinnamon), </span><i><span style=\"font-weight: 400;\">elaichi </span></i><span style=\"font-weight: 400;\">(cardamom), </span><i><span style=\"font-weight: 400;\">saumph </span></i><span style=\"font-weight: 400;\">(fennel seed), </span><i><span style=\"font-weight: 400;\">kaali mirch</span></i><span style=\"font-weight: 400;\"> (black pepper), </span><i><span style=\"font-weight: 400;\">moringa</span></i><span style=\"font-weight: 400;\">, </span><i><span style=\"font-weight: 400;\">amla</span></i><span style=\"font-weight: 400;\">, </span><i><span style=\"font-weight: 400;\">giloy</span></i><span style=\"font-weight: 400;\">, </span><i><span style=\"font-weight: 400;\">ashwagandha </span></i><span style=\"font-weight: 400;\">and more. Cherry on top? All of these ingredients are cooked with premium basmati rice!</span></p>\n<p><span style=\"font-weight: 400;\">Every ingredient is purposefully hand-picked and slow-cooked with care to meet your dog's daily nutritional needs and culinary wants.</span></p>\n<p><b>WHAT YOU SEE IS WHAT YOU GET:</b></p>\n<p><span style=\"font-weight: 400;\">50% MEAT  |  50% VEG &amp; RICE  |  HUMAN GRADE INGREDIENTS</span></p>\n<p><b>WHAT YOU PUT IN THEIR BOWL MATTERS:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No added preservatives or fillers</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Optimal Protein for growth &amp; healthy living</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Essential fatty acids and micronutrients help build immunity</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Loaded with antioxidants that help prevent diseases</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Aids in weight management</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Omega 3 fatty acids help reduce inflammation</span></li>\n</ul>\n<p><b>WHAT MAKES SARA's FOOD FRESH?</b></p>\n<p><span style=\"font-weight: 400;\">Locally sourced, farm-fresh ingredients arrive at our state-of-the-art kitchen.</span></p>\n<p><span style=\"font-weight: 400;\">                                                        <span data-mce-fragment=\"1\">:</span></span></p>\n<p><span style=\"font-weight: 400;\">These purposeful ingredients are slow-cooked in small batches to retain maximum nutrients.</span></p>\n<p><span style=\"font-weight: 400;\">                                                        <span data-mce-fragment=\"1\">:</span></span></p>\n<p><span style=\"font-weight: 400;\">The food is packed in a retort packaging to ensure it remains fresh without the use of any preservatives or stabilizers.</span></p>\n<p><span style=\"font-weight: 400;\">                                                        <span data-mce-fragment=\"1\">:</span></span></p>\n<p><span style=\"font-weight: 400;\">The result is a wholesome &amp; nutritious bowl of food for your pet to enjoy.</span></p>\n<p><b>We are taking on the responsibility of cooking complete, balanced meals for your pets.</b></p>\n<p><span style=\"font-weight: 400;\">Serve this flavorful recipe of love with great ease and convenience.</span></p>\n<p><span style=\"font-weight: 400;\">All the meals are ready to eat. Just </span><b>cut</b><span style=\"font-weight: 400;\">, </span><b>open </b><span style=\"font-weight: 400;\">&amp; </span><b>serve</b><span style=\"font-weight: 400;\">.</span></p>\n<p><span style=\"font-weight: 400;\">Once opened, refrigerate and consume within 48 hours. Store in a clean and dry place, away from direct sunlight.</span></p>\n<p><b>Feeding Instructions: </b><span style=\"font-weight: 400;\">(As per your dog's weight)</span></p>\n<ul>\n<li>\n<b>Upto 8 kg:</b><span style=\"font-weight: 400;\"> ½ pack/day</span>\n</li>\n<li>\n<b>8-15 kg:</b><span style=\"font-weight: 400;\"> 1 pack/day</span>\n</li>\n<li>\n<b>15-25 kg:</b><span style=\"font-weight: 400;\"> 2 packs/day</span>\n</li>\n<li>\n<b>25-35 kg: </b><span style=\"font-weight: 400;\">2.5-3 packs/day</span>\n</li>\n</ul>\n<p><span style=\"font-weight: 400;\"><b>Wholesome Wisdom:<span> </span></b><i data-mce-fragment=\"1\">Feeding your pets is your love language, and believe us, we get it. But let's express our love through quality and not quantity.</i></span></p>\n<p><span style=\"font-weight: 400;\"><i data-mce-fragment=\"1\"><b data-stringify-type=\"bold\">Note: </b>For Free Product please add <strong><a class=\"c-link\" data-stringify-link=\"https://headsupfortails.com/products/huft-sea-breeze-perfume-for-dogs\" data-sk=\"tooltip_parent\" href=\"https://headsupfortails.com/products/huft-sea-breeze-perfume-for-dogs\" target=\"_blank\" delay=\"150\">HUFT Perfume</a></strong> in your Cart.</i></span></p>\n<style type=\"text/css\"><!--\ntd {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}\n--></style>",
